    SetLinha(linha,senha)
}



function Tabela() {



    return (
        <table className="table" id='tabela'>
            <thead>
                <tr>
                    <th scope="col">Usu√°rio</th>
                    <th scope="col">Utilidade</th>
                    <th scope="col">Senha</th>
                </tr>
            </thead>
            <tbody>
                {linha.map((senha,index) => (
                    <tr key={index}>
                        <td>{senha.coluna1}</td>
                        <td>{senha.coluna2}</td>
                        <td>{senha.coluna3}</td>
                    </tr>
                ))}
            </tbody>
        </table>

    )
}

export default Tabela
